import modelop_sdk.dashboard.dashboard_monitor_service as dashboard_monitor_service
import modelop_sdk.utils.logging as logger
from modelop_sdk.utils import dict_utils
import json
import numpy
import pandas

LOG = logger.configure_logger()


def get_default_modelop_fields_from_deployable_model(deployable_model: dict = None) -> dict:
    """
        Method that extracts the default modelop fields from the deployable_model dict.
            Current default modelop fields:
                -modelUseCategory
                -modelOrganization
                -modelRisk
    """
    if deployable_model is None:
        raise ValueError("deployable_model can't be None")

    if not isinstance(deployable_model, dict):
        raise ValueError(f"deployable_model is not a dict , instead is {str(deployable_model)} ")

    modelop_fields = {}
    modelop_fields.update({'modelUseCategory':
                               deployable_model.get('storedModel', {}).get('modelMetaData', {})
                          .get('modelUseCategory', '')})

    modelop_fields.update({'modelOrganization': deployable_model.get('storedModel', {}).get('modelMetaData', {})
                          .get('modelOrganization', '')})

    modelop_fields.update({'modelRisk': deployable_model.get('storedModel', {}).get('modelMetaData', {})
                          .get('modelRisk', '')})

    return modelop_fields


def dict_values_to_numeric_array(input_dict: dict = None) -> []:
    """
    Method that generates an array of the numeric values extracted from the input dict
        input:
            input_dict: dict
        output:
            [] : with the numeric values of the dict
        usage:
            sample_input = {
                    "foo":1,
                    "bar":0.5,
                    "foo_bar":"not_a_number"
                }

            output = [1,0.5]
    """
    if input_dict is None:
        raise ValueError("input_dict can't be None")

    if not isinstance(input_dict, dict):
        raise ValueError(f"input_dict is not an instance of dict, instead {type(input_dict)}")
    numeric_array = []
    for key, value in input_dict.items():
        if isinstance(value, (int, float, complex)):
            numeric_array.append(value)

    return numeric_array


def get_dict_root_entries_with_suffix(input_dict: dict, ends_with_suffix: str) -> dict:
    """
    Method that iterates through a dict and extract dict entries with numeric values ending with a predefined suffix
        inputs:
            input_dict : dict to be evaluated
            ends_with_suffix: suffix used to be matched
        Usage example:

            input:
            test_dict ={
                        "entry_1_bar":1,
                        "entry_2_bar":"not_number",
                        "3_entry_bar": { "test":"bar_second_level" },
                        "4_entry_bar":2.0,
                        "entry_5_bar":0.9,
                        "6_entry_bar":-500,
                        "7_entry_foo":1000,
                        "8_entry_foo":"not_number",
                        "9_entry_bar_foo":20
                    }

            Method call:
            output = get_dict_root_entries_with_suffix(test_dict,"_bar")

            output:
            {
                 "entry_1_bar":1,
                 "4_entry_bar":2.0,
                "entry_5_bar":0.9,
                "6_entry_bar":-500
            }
    """

    if input_dict is None:
        raise ValueError("input_dict cant be None")

    if ends_with_suffix is None or len(ends_with_suffix.strip()) == 0:
        raise ValueError("ends_with_suffix input can't be None nor empty")

    matched_dict_entries = {}
    try:
        for key, value in input_dict.items():
            if key.endswith(ends_with_suffix):
                try:
