def assert_df_not_none_and_not_empty(dataframe, error_message_prefix: str = None):
    """
    Method that validates whether the input dataframe is not None and not empty, otherwise will raiseValue exception
        input:
            dataframe: dataframe to be evaluated
            error_message_prefix: (optional) text prefix to be added at the beginning of the error message
    """
    if error_message_prefix is not None and not isinstance(error_message_prefix, str):
        raise ValueError("error_message_prefix must be str")

    if error_message_prefix is None:
        error_message_prefix = "Input dataframe"

    if not isinstance(dataframe, pandas.core.frame.DataFrame):
        raise ValueError(f"{error_message_prefix} is not instance of pandas.core.frame.DataFrame")

    if dataframe is None:
        raise ValueError(f"{error_message_prefix} can't be none")

    if dataframe.empty:
        raise ValueError(f"{error_message_prefix} can't be empty")


def evaluate_results(monitor_results: dict = None, dmn_filename: str = None) -> dict:
    """
    Method that performs the dashboard_evaluation
    """
    ## removing any sort of numpy enconding/decoding issues
    monitor_results_str = json.dumps(monitor_results, cls=NpEncoder)
    monitor_results_dict = json.loads(monitor_results_str)
    # performing evaluation here
    evaluated_results = dashboard_monitor_service.evaluate_results(monitor_results_dict, dmn_filename)
    # Generating heatmap
    if evaluated_results.response.ok:
        return evaluated_results.json
    else:
        try:
            error_details = f"Evaluation error: {evaluated_results.response.text} "
        except:
            error_details = "Error during evaluation"
        LOG.error(
            f"Error: {error_details}")
        raise Exception(error_details)


class NpEncoder(json.JSONEncoder):
    """
    Numpy encoder for JSON library, required because DMN evaluation was failing when input dictionary contained entries
    pointing to int64 values, and JSON is not able to encode/decode numpy types yet.
    """

    def default(self, obj):
        if isinstance(obj, numpy.integer):
            return int(obj)
        if isinstance(obj, numpy.floating):
            return float(obj)
        if isinstance(obj, numpy.ndarray):
            return obj.tolist()
        return super(NpEncoder, self).default(obj)


def generate_heatmap(evaluation_results: [] = None, include_summary: bool = False) -> dict:
    """
    Function that generates the heatmap from the evaluation results
    """

    heatmap_dict = {}
    for evaluation_entry in evaluation_results:
        try:
            if evaluation_entry.get('monitor_name') is not None:
                monitor_name_key = evaluation_entry.get('monitor_name')
                if heatmap_dict.get(monitor_name_key) is None:
                    heatmap_dict.update({monitor_name_key: {"testResult": evaluation_entry.get("color")}})
                else:
                    LOG.warning(
                        f"Duplicated evaluated DMN entries found for {monitor_name_key}, ignoring entry: {str(evaluation_entry)}, and keeping first found: {str(heatmap_dict.get(monitor_name_key))}")
        except Exception as ex:
            LOG.error(
                f"Something went wrong while processing evaluated monitor entry {str(evaluation_entry)} , error: {str(ex)}")

    if len(heatmap_dict) == 0:
        LOG.warning("No monitors found for heatmap, likely something went wrong with DMN evaluation")

    heatmap = {}
    if include_summary and heatmap_dict is not None and heatmap_dict:
        summary = generate_summary(heatmap_dict)
        heatmap.update(summary)
    heatmap.update(heatmap_dict)
    return {"heatMap": heatmap}


def generate_summary(heatmap_dict: dict) -> dict:
    # Evaluation color
    default_evaluation_color = "Gray"
    green_evaluation_color = "Green"
    yellow_evaluation_color = "Yellow"
    red_evaluation_color = "Red"
    black_evaluation_color = "Black"

    LOG.info("Generating summary")
    # By default summary color is Green
    summary_color = green_evaluation_color
    gray_color_counter = 0
    green_color_counter = 0
    yellow_color_counter = 0
    red_color_counter = 0

    # Generate summary from heatmap, Summary will be placed at the beginning of the heatmap
    for heatmap_key in heatmap_dict:
        heatmap_value = heatmap_dict[heatmap_key]
        if heatmap_value.get("testResult") is not None:
            test_result_color = heatmap_value.get("testResult")

            if test_result_color == red_evaluation_color:
                summary_color = red_evaluation_color
                red_color_counter += 1
            elif test_result_color == yellow_evaluation_color:
                yellow_color_counter += 1
                if summary_color != red_evaluation_color:
                    summary_color = yellow_evaluation_color
            elif test_result_color == default_evaluation_color:
                gray_color_counter += 1
                # in Gray if not RED then Yellow
                if summary_color != red_evaluation_color:
                    summary_color = yellow_evaluation_color

            elif test_result_color == green_evaluation_color:
                green_color_counter += 1

    if summary_color == green_evaluation_color and green_color_counter == 0:
        summary_color = default_evaluation_color

    summary = {"Summary": {
        "testResult": summary_color,
        "description": "Monitors summary",
        "monitorResults": {
            "Gray": gray_color_counter,
            "Green": green_color_counter,
            "Yellow": yellow_color_counter,
            "Red": red_color_counter
        }
    }}

    return summary

